column4:
Telefonul se încălzise prea mult și s-a oprit pentru a se răci. Acum telefonul funcționează normal.

Telefonul s-ar putea încălzi prea mult dacă:
 • folosești aplicații care consumă multe resurse (de ex., jocuri, aplicații video/de navigare);
 • descarci/încarci fișiere mari;
 • folosești telefonul la temperaturi ridicate.

În timpul procesului de mutare: 
• nu scoate ^1; 
• unele aplicații nu vor funcționa corect; 
• păstrează dispozitivul încărcat.

