column4:
Atunci când o aplicație este fixată, aceasta poate deschide alte aplicații și pot fi accesate date cu caracter personal. 

Pentru a folosi fixarea aplicației: 
1. activează fixarea aplicației; 
2. deschide Recente; 
3. atinge pictograma aplicației din partea de sus a ecranului, apoi atinge Fixează.

Atunci când o aplicație este fixată, aceasta poate deschide alte aplicații și pot fi accesate date cu caracter personal. 

Dacă vrei să permiți în siguranță accesul cuiva la dispozitivul tău, folosește un utilizator invitat. 

Pentru a folosi fixarea aplicației: 
1. activează fixarea aplicației; 
2. deschide Recente; 
3. atinge pictograma aplicației din partea de sus a ecranului, apoi atinge Fixează.

Dacă o aplicație nu este folosită timp de câteva luni:

• permisiunile sunt eliminate pentru a vă proteja datele;
• notificările sunt dezactivate pentru a economisi baterie;
• fișierele temporare sunt eliminate pentru a elibera spațiu.

Pentru a acorda permisiuni și a permite notificări, deschideți aplicația.
